import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class ServerDataService {
  private servers: Server[] = [];

  constructor() {}

  getServers(): Server[] {
    return this.servers;
  }

  addServer(server: Server): void {
    this.servers.push(server);
  }

  clearServers(): void {
    this.servers = [];
  }
}
